import classes from './AllMedics.module.css' ;
import MedicsList from './MedicsList';
import React, { useState } from 'react';
import lovin from './lovin.png'


const medics_data = [
    {
        name: 'Andrei Lovin',
        description: 'Urolog',
        image: lovin
    },
    {
        name: 'Maria Rodriguez',
        description: 'Pediatrician',
        image: 'https://example.com/maria.jpg'
    },
    {
        name: 'John Smith',
        description: 'Cardiologist',
        image: 'https://example.com/john.jpg'
    },
    {
        name: 'Sarah Lee',
        description: 'Dermatologist',
        image: 'https://example.com/sarah.jpg'
    },
    {
        name: 'Michael Chang',
        description: 'Orthopedic Surgeon',
        image: 'https://example.com/michael.jpg'
    },
    {
        name: 'Emily Davis',
        description: 'Neurologist',
        image: 'https://example.com/emily.jpg'
    },
    // Add more medics as needed
];

function AllMedics() {
    const [searchTerm, setSearchTerm] = useState('');

    return (
        <section>
            <h1 className={classes.header}>All Medics</h1>
            <input
                type="text"
                placeholder="Search medics"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className={classes.searchContainer}
            />
            <MedicsList medics={medics_data} searchTerm={searchTerm} />
        </section>
    );
}



export default AllMedics;
